import React, {Component} from 'react';
import Car from './Car';

class Form extends Component {

    render(){

        return (

        <div>

            <Car color="green" height="400"/>
            <h1>Commentaire </h1>
            <form>

                <label>Pseudo</label>
                <input type="texte" value=""  />

            </form>
        </div>
        )
    }
}

export default Form;
